//import './App.css';
import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

/////////////////////////////////////////////////////// M-ui
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

/////////////////////////////////////////////////////// File
import Navbar from '../../LayUot/Navbar'

/////////////////////////////////////////////////////// Path Component
import Search from './Search'
import Information from './Inofrmation'
import Add from './Add'
import Out from './Out'
import History from './History'


const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    margin: '10px'
  },
  Navbar: {
    padding: theme.spacing(8),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  Footer: {
    padding: theme.spacing(8),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  PaperL: {
    padding: theme.spacing(8),
    height: 600 ,
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  PaperR: {
    padding: theme.spacing(8),
    height: 600 ,
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }
}));


function Dasboard() {
  const classes = useStyles();

  return (
    <div className="App">
      <div className={classes.root}>
        <Grid container spacing={3}>
          <Grid item xs={12}>
            <Paper className={classes.Navbar}>
              <h1>Facility Store</h1>
            </Paper>
          </Grid>
          <Grid item xs={3}>
          <Paper className={classes.PaperR}>
            <Navbar />
          </Paper>
          </Grid>
          <Grid item xs={9}>
            <Paper className={classes.PaperL}>
              <Router>
                <Switch>
                  <Route path="/Search" component={Search}></Route>
                  <Route path="/Information" component={Information}/>
                  <Route path="/Add" component={Add}/>
                  <Route path="/Out" component={Out}/>
                  <Route path="/History" component={History}/>
                </Switch>
              </Router>
            </Paper>
          </Grid>
          <Grid item xs={12}>
            <Paper className={classes.Footer}>Footer</Paper>
          </Grid>
        </Grid>
      </div>
    </div>
  );
}

export default Dasboard;
